import React from "react";
import logo from '../../images/logo.png';
import './chat.css';
import { Link } from "react-router-dom";

const Chat = () => {
  return (
    <div className="mainPage">
      <div className="container">
          <img src={logo} alt="logo"/>
          <h1>Statiq Chat</h1>
          <input placeholder="Enter your name" type="text" id="textinput"/>
          <Link>
          <button className="button-17">Log In</button>
          </Link>
      </div>
    </div>
  );
};

export default Chat;
